import ReactDom from "react-dom";

const items = ["TV","Fridge","AC"];

const element = <div>

<ol> 
 {
   items.map((item,index)=> <li key={index}> {item}</li>) 
 } 
 </ol>
 </div>

 class Header extends Component{
   render(){
    return <h1>Item List</h1>
   };
 };

ReactDom.render(element,document.getElementById("root"));
